import useSWR from 'swr';
import dummyUser from '../swr/user';


export default () => {
    const { data: userData } = useSWR("dummyUserState", { initialData: dummyUser });
    const [me, setMe] = useState((userData || {}).me);
    return [me, setMe];

};
